	add("barbotte", "{\"term\":\"barbotte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Turkish\"], \"text\":\"From Turkish \u0027barbut\u0027 \u0026lt;ref\u0026gt;[http://www.merriam-webster.com/dictionary/barbotte \u0026quot;barbotte.\u0026quot;] \u0027Webster\u0027s Third New International Dictionary, Unabridged.\u0027 Merriam-Webster. 2002.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Canadian dice game akin to craps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, Ernest Evred Blanche, \u0027You can\u0027t win: facts and fallacies about gambling\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Canadians prefer the game of \u0027\u0027barbotte\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, Richard A Epstein, \u0027The theory of gambling and statistical logic\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Barbotte\u0027\u0027 is a Canadian version of Craps wherein the player wins if the two dice produce 3-3, 5-5, 6-6, or 6-5\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, James H Marsh, \u0027The Canadian encyclopedia\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For the past century or so the most popular gambling games have been the card games of poker, stook and blackjack, and the dice games of craps and \u0027\u0027barbotte\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Suzanne Morton, \u0027At Odds\u0027, \u0027Gambling and Canadians 1919–1969\u0027, University of Toronto Press, ISBN 0802084419, page 49\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Games in such clubs ranged from poker, through roulette to location-specific pastimes such as the Montreal dice game \u0027\u0027barbotte\", \"priority\":9}]}, \"synonyms\":{}}");

