	add("barchan", "{\"term\":\"barchan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Kazakh\", \"Russian\"], \"text\":\"From Russian \u0027барха́н\u0027 from Kazakh \u0027бархан\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An arc-shaped sand ridge comprised of well-sorted sand\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, Edwin Sherbon Hills, \u0027Arid Lands: A Geographical Appraisal\u0027, barchans%22\u0026amp;hl\u003den\u0026amp;ei\u003dK-h9TvfwO8bEmAXcq9iiBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d5\u0026amp;ved\u003d0CEIQ6AEwB\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"barchans%22\u0026amp;f\u003dfalse page 72\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The sand is usually very well sorted in \u0027\u0027barchans\u0027\u0027, for it is constantly re-worked as the dune ‘marches’. The marching also causes cross-bedding inside the \u0027\u0027barchan\u0027\u0027, with a dip parallel to the sand-fall face\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, \u0027The Mysteries of Algiers\u0027, Dedalus 1993, p. 69\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"But to follow the dunes around the foot of their slopes is also tedious and one can walk for half a kilometre east or west, finding one \u0027\u0027barchan\u0027\u0027 linked to another and no easy way through […\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Julie Laity, \u0027Deserts and Desert Environments\u0027, barchans%22\u0026amp;hl\u003den\u0026amp;ei\u003dW-x9TuHVJ7CXmQXJlOGiBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDUQ6AEwAjg\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"barchans%22\u0026amp;f\u003dfalse page 205\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Barchans and transverse dunes are essentially of the same type, forming and migrating under a unidirectional wind regime. The difference between the two is related to the amount of sand: barchans are isolated mounds, whereas transverse dunes are composed of many \u0027\u0027barchans\u0027\u0027 coalesced into a single, longer dune form (Tsoar 2001\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Robert S. Anderson, Suzanne P. Anderson, \u0027Geomorphology: The Mechanics and Chemistry of Landscapes\u0027, barchans%22\u0026amp;hl\u003den\u0026amp;ei\u003dK-h9TvfwO8bEmAXcq9iiBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CDIQ6AEwA\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"barchans%22\u0026amp;f\u003dfalse page 482\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Perhaps the most distinctive is the \u0027\u0027barchan\u0027\u0027 dune, an isolated crescentic form with arms that stretch downwind. \u0027\u0027Barchans\u0027\u0027 are not huge, often with heights of only a few meters\", \"priority\":12}]}, \"synonyms\":{}}");

