	add("barfogenesis", "{\"term\":\"barfogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027barf\u0027 + \u0027-o. English|-o-\u0027 + \u0027-genesis\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"motion Motion sickness caused by video media, particularly video games and virtual reality environments\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, David W. Knight, \u0026quot;\u0027Wolverine\u0027s Revenge\u0027 offers one heck of a ride,\u0026quot; \u0027Indianapolis Star\u0027, 2 May 2003\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Camera control is especially tough to learn and can leave players with a case of \u0027\u0027barfogenesis\", \"priority\":3}]}, \"synonyms\":{}}");

	add("barge", "{\"term\":\"barge\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"coptic\", \"egyptian (ancient)\", \"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027barge\u0027 (boat) from \u0027barca\u0027 from Ancient greek (to 1453) \u0027βάρις\u0027 (egyptian boat) from Coptic \u0027ⲃⲁⲁⲣⲉ\u0027 (small boat) from Egyptian (ancient) {{m|egy|sc\u003dLatn|*bēre}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large flat-bottomed towed or self-propelled boat used mainly for river and canal transport of heavy goods or bulk carg\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A richly decorated ceremonial state vessel propelled by rowers for river procession\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large flat-bottomed coastal trading vessel having a large spritsail and jib-headed topsail, a fore staysail and a very small mizen, and having leeboards instead of a kee\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One of the boats of a warship having fourteen oar\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The wooden disk in which bread or biscuit is placed on a mess tabl\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A double-decked passenger or freight vessel, towed by a steamboat\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A large omnibus used for excursions\", \"priority\":7}]}, \"synonyms\":{}}");

	add("bargain", "{\"term\":\"bargain\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027bargaynen\u0027 (to bargain, make a pledge for sale) from Anglo-norman \u0027bargaigner\u0027 from Old french (842-ca. 1400) \u0027bargaigner\u0027 from Frankish {{m|frk|*borganjan||to borrow, lend}}, from Proto-germanic {{m|gem-pro|*burgijaną||to borrow, lend}}, from Proto-indo-european {{m|ine-pro|*bhergh-||to protect, secure}}. Akin to Old high german (ca. 750-1050) \u0027boragen\u0027 \u0027borgen\u0027 (German \u0027borgen\u0027 () , Old english (ca. 450-1100) \u0027borgian\u0027 (to borrow, lend, pledge) More at borrow.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An agreement between parties concerning the sale of property; or a contract by which one party binds himself to transfer the right to some property for a consideration, and the other party binds himself to receive the property and pay the consideration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A contract is a \u0027\u0027bargain\u0027\u0027 that is legally binding\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An agreement or stipulation; mutual pledge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And whon your honors mean to solemnize The \u0027\u0027bargain\u0027\u0027 of your faith\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An item (usually brand new) purchased for significantly less than the usual, or recommended, price; also (when not qualified), a gainful transaction; an advantageous purchase\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Thus the red damask curtains which now shut out the fog-laden, drizzling atmosphere of the Marylebone Road, had cost a mere song, and yet they might have been warranted to last another thirty years. A great \u0027\u0027bargain\u0027\u0027 also had been the excellent Axminster carpet which covered the floor\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The thing stipulated or purchased\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She was too fond of her most filthy \u0027\u0027bargain\", \"priority\":8}]}, \"synonyms\":{}}");

	add("bargainor", "{\"term\":\"bargainor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|bargain|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who makes a bargain or contract with another, especially to sell property\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bargee", "{\"term\":\"bargee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A crewman of a working barge\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bargeman", "{\"term\":\"bargeman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the crew of a barge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A barge owner, maintainer, or captain of a barge\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A nickname for a large white maggot, that frequently infested ship\u0027s biscuits; most likely a larva of the cadelle beetle, \u0027w:Tenebroides Tenebroides mauritanicus\", \"priority\":3}]}, \"synonyms\":{}}");

	add("bargirl", "{\"term\":\"bargirl\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bar|girl|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female who works as a hostess in a bar, typically in Southeast Asia and catering to male clients, and who may provide personal entertainment or sexual services\", \"priority\":1}]}, \"synonyms\":{}}");

	add("baria", "{\"term\":\"baria\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"baryta\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bariomicrolite", "{\"term\":\"bariomicrolite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bario|microlite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An isometric-hexoctahedral mineral containing barium, hydrogen, niobium, oxygen, and tantalum\", \"priority\":1}]}, \"synonyms\":{}}");

	add("baritsu", "{\"term\":\"baritsu\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Variant of \u0027\u0027 used mainly after Conan Doyle (for whom it may have been a misprint).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Bartitsu, a martial art, based on jujitsu, popular in late-Victorian England\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barkeep", "{\"term\":\"barkeep\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bar|keep|lang\u003den}}, possibly a clipping of \u0027barkeeper\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a bartende\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1873\u0027\u0027: Bret Harte, \u0027Mrs. Skaggs\u0027s Husbands\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I sez to the \u0027\u0027barkeep\u0027\u0027 o\u0027 the hotel, \u0026quot;Show me the biggest doctor here.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027: \u0027Frasier\u0027 (TV, episode 6.13\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Barkeep\u0027\u0027, a couple of beers here, please\", \"priority\":5}]}, \"synonyms\":{}}");

	add("barking", "{\"term\":\"barking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A town in London\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barley", "{\"term\":\"barley\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027barli\u0027 \u0027barly\u0027 from Old english (ca. 450-1100) (adj.) {{m|ang|bærlīċ||barley-like}}, from \u0027bere\u0027 (barley) (compare Scots {{m|sc|bere||six-rowed barley}}), from Proto-germanic {{m|gem-pro|*baraz}} (compare Old Norse \u0027barr\u0027 , from Proto-indo-european {{m|ine-pro|*bʰars}}- ‘spike, prickle’ (compare Welsh \u0027bara|lang\u003dcy\u0027 () Latin \u0027far|lang\u003dla\u0027 () Serbo-Croatian {{m|sh|sc\u003dCyrl|бра̏шно}}/{{m|sh|brȁšno}} ‘flour’, Albanian \u0027bar|lang\u003dsq\u0027 () Ancient Greek \u0027φήρον\u0027 (plant deity) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cereal of the species \u0027Hordeum vulgare\u0027, or its grains, often used as food or to make beer and other malted drinks\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barmaid", "{\"term\":\"barmaid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman who works in a bar\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barman", "{\"term\":\"barman\", \"etymology\":{\"influencers\":[], \"languages\":[\"Czech\", \"English\"], \"text\":\"From English \u0027barman\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who works in a bar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027 September 28, w:Kenan Kenan Malik, \u0026quot;[http://www.nytimes.com/2013/09/29/opinion/sunday/london-is-special-but-not-that-special.html?ref\u003dopinion London Is Special, but Not That Special],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 28 September 2013)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"NOT so long ago there was a beer commercial on British TV in which two pointy-headed aliens order a pint in a rural pub. “Up from London, are we?” the \u0027\u0027barman\u0027\u0027 asks politely\", \"priority\":3}]}, \"synonyms\":{}}");

	add("barnaby", "{\"term\":\"barnaby\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"originally, a lively and fast-paced dance; by extension, any quick and uneven movement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1640\u0026amp;ndash;1687\u0027\u0027, Charles Cotton, in his burlesque of Virgil\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bounce cry the port-holes, out they fly\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And make the world dance \u0027\u0027Barnaby\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Gregory Sass, \u0027Redcoat\u0027, page 28\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It was a regular \u0027\u0027Barnaby\u0027\u0027 dance; I\u0027d never seen anyone move so quickly. Before the culprit bolted out the door into the night\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Jo Ann Ferguson, \u0027Miss Charity\u0027s Case\u0027, page 182\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;Owell gave me this. Said to get it to you in a \u0027\u0027Barnaby\u0027\u0027 dance. \u0027Ere it is.\u0026quot; His tongue scraped across his lower lip as he stared at Charity\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Julia Golding, \u0027The Diamond of Drury Lane\u0027, page 434\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"We were now doing a strange sort of \u0027\u0027Barnaby\u0027\u0027 dance: shuffling to and fro as I blocked his attempts to set off in pursuit\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"quot;No. Sadly, Pedro Hawkins died of a fever last Monday. That was the understudy you saw.\u0026quot\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"quot;Balderdash\", \"priority\":12}]}, \"synonyms\":{}}");

	add("barnacle", "{\"term\":\"barnacle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"Welsh\", \"English\", \"middle english (1100-1500)\", \"French\", \"Irish\", \"ancient greek (to 1453)\", \"old irish (to 900)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|barnakille}}, from earlier {{m|enm|bernake}}, {{m|enm|bernekke}}, from \u0027bernaque\u0027 (barnacle) (compare French {{m|fr|barnache}}), from {{m|la|*bernacca||limpet}}, from Gaulish (compare Welsh {{m|cy|brennig}}, Irish {{m|ga|báirneac}}), from Proto-celtic {{m|cel-pro|*barinākos}}, from {{m|cel-pro|*barinā||rock, rocky ground}} (compare Old irish (to 900) {{m|sga|barenn||boulder}}), from Proto-indo-european {{m|ine-pro|*gʷr̥H-||hill, mountain}} + Proto-celtic {{m|cel-pro|*-ākos}}, from Proto-indo-european {{m|ine-pro|*-kos}}, {{m|ine-pro|*-ḱos}}; for sense development, compare Ancient greek (to 1453) {{m|grc|λέπας||rock}} which gave {{m|grc|λεπάς||limpet}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A marine crustacean of the subclass Cirripedia that attaches itself to submerged surfaces such as tidal rocks or the bottoms of ships\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The barnacle goose\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In electrical engineering, a change made to a product on the manufacturing floor that was not part of the original product design\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"On printed circuit boards, a change such as soldering a wire in order to connect two points, or addition such as an added resistor or capacitor, subassembly or daughterboard\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An instrument like a pair of pincers, to fix on the nose of a vicious horse while shoeing so as to make it more tractable\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A nickname for spectacles\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A good job, or snack easily obtained\", \"priority\":7}]}, \"synonyms\":{}}");

	add("barndoor", "{\"term\":\"barndoor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|barn|door|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The large door of a bar\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barnes", "{\"term\":\"barnes\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An English topographic surname for someone who owned, lived in, or worked in a barn\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An English habitational surname for someone from the place of the same name in Surrey\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A town originally in Surrey, now a district of London\", \"priority\":3}]}, \"synonyms\":{}}");

	add("barnet", "{\"term\":\"barnet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a borough in Greater Londo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a town in this borough, also called \u0027Chipping Barnet\", \"priority\":2}]}, \"synonyms\":{}}");

