	add("barnyard", "{\"term\":\"barnyard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|barn|yard|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The yard associated with or surrounding a barn\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barochore", "{\"term\":\"barochore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|baro|chore|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organism that spreads by weight, as by the weight of a nut that falls from a tree and is not eaten by animals\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barochory", "{\"term\":\"barochory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|baro|chory|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The dispersal of seeds, spores, or fruit by gravity alone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barognosis", "{\"term\":\"barognosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to evaluate the weight of objects, or to differentiate objects of different weights by holding or lifting them\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barograph", "{\"term\":\"barograph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|baro|graph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of barometer that continuously records air pressure on a sheet or rotating dru\", \"priority\":1}]}, \"synonyms\":{}}");

