	add("barometry", "{\"term\":\"barometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The art or process of making barometrical measurements\", \"priority\":1}]}, \"synonyms\":{}}");

	add("baroness", "{\"term\":\"baroness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The female ruler of a barony. The male equivalent is baron\", \"priority\":1}]}, \"synonyms\":{}}");

	add("baronet", "{\"term\":\"baronet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hereditary title, below a peerage and senior to most knighthoods, entitling the bearer to the titular prefix \u0026quot;Sir\u0026quot; (for men) or \u0026quot;Dame\u0026quot; (for women) which is used in conjunction with the holder\u0027s Christian name. It is inheritable, usually by the eldest son although a few baronetcies can also pass through the female line\", \"priority\":1}]}, \"synonyms\":{}}");

	add("baronetcy", "{\"term\":\"baronetcy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|baronet|cy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the rank of a baronet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("baronetess", "{\"term\":\"baronetess\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|baronet|ess|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The wife of a baronet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barony", "{\"term\":\"barony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The domain of a baron or baroness, usually as part of a larger kingdom or empire\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an English administrative division originally reckoned as comprising 100 hides and in various numbers composing counties\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"W. Petty, \u0027The Political Anatomy of Ireland\u0027, page 326\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In Ireland... an\u0026lt;!--sic--\u0026gt; head constable for each \u0027\u0027barony\u0027\u0027 or hundred, being 252\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1873\u0027\u0027, General Report on the Census of England, volume IV, page 181\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Baronies\u0027\u0027 appear to have been formed successively on the submission of the Irish chiefs... the territory of each constituting a \u0027\u0027barony\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any large manor or estate, regardless of its owner\u0027s rank\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The baronage: the body of barons in a realm\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Baronship, the rank or position of a baron\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The legal tenure of a baron\u0027s land; military tenure\", \"priority\":10}]}, \"synonyms\":{}}");

	add("baroreceptor", "{\"term\":\"baroreceptor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|baro|receptor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A nerve ending that is sensitive to changes in blood pressure\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barotaxis", "{\"term\":\"barotaxis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The movement of a cell or an organism in response to pressure\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barry", "{\"term\":\"barry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A field divided transversely into several equal parts, and consisting of two different tinctures interchangeably disposed\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barracks", "{\"term\":\"barracks\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of buildings used by military personnel as housing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barracuda", "{\"term\":\"barracuda\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}1670s, from American Spanish, perhaps from a Carib word.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any large marine fish of the genus that have elongated bodies, a projecting lower jaw, displaying prominent fang-shaped teeth, and are aggressive predators\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An unethically predatory person\", \"priority\":2}]}, \"synonyms\":{}}");

	add("barratry", "{\"term\":\"barratry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Early 15th century, in sense “sale of offices”, from Old french (842-ca. 1400) \u0027baraterie\u0027 (deceit, trickery) from \u0027barat\u0027 (fraud, deceit, trickery) of {{unk.|en}} origin, perhaps \u0026lt;ref name\u003d\u0026quot;oetyld\u0026quot;\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; In marine sense of “unlawful acts causing loss to owner”, 1620s.\u0026lt;ref name\u003d\u0026quot;oetyld\u0026quot; /\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of persistently instigating lawsuits, often groundless one\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the sale and/or purchase of political positions of powe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"unlawful or fraudulent acts by the crew of a vessel, harming the vessel\u0027s owner\", \"priority\":3}]}, \"synonyms\":{}}");

	add("barrelage", "{\"term\":\"barrelage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"barrel + -age\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Quantity of beer (or other drink) measured in barrel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1909\u0027\u0027, Lord Fitzmaurice, \u0027[http://hansard.millbanksystems.com/lords/1909/mar/31/hops-bill-hl-second-readin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"S5LV0001P0_19090331_HOL_27 Hansard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That is a very large question, and I do not propose to go into it in any detail; but from such figures as I have been able to obtain, I am bound to say that it does appear that there has been not only a diminution, as was pointed out by the Committee, in the \u0027\u0027barrelage\u0027\u0027 of beer brewed in the United Kingdom, but also in the consumption of spirits\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Andrew Barker, \u0027[http://www.morningadvertiser.co.uk/General-News/Mitchells-barrelage-rise The Publican\u0027s Morning Advertiser\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;We have made real progress since taking over, illustrated by a very healthy increase in \u0027\u0027barrelage\u0027\u0027, and the various investments put us in a good position to move forwards,\u0026quot; he said\", \"priority\":6}]}, \"synonyms\":{}}");

	add("barrelette", "{\"term\":\"barrelette\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|barrel|ette|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A structure in the mouse brain associated with a particular whisker\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barreleye", "{\"term\":\"barreleye\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|barrel|eye|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, deep-sea osmeriform fish of the family \u0027\u0027, with barrel-shaped, tubular eyes which are generally directed upwards to detect the silhouettes of available prey\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barrelful", "{\"term\":\"barrelful\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|barrel|ful|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"As much as a barrel will hold\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large amount\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027, \u0027Kiplinger\u0027s Personal Finance\u0027 (volume 6, number 8, August 1952, page 32\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Chlorophyl is showing up by the \u0027\u0027barrelful\u0027\u0027 in beauty lotions, tooth pastes, soaps, chewing gum, mouthwashes, antihalitosis tablets, tobacco and dog food\", \"priority\":4}]}, \"synonyms\":{}}");

