	add("barreling", "{\"term\":\"barreling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A defect in which a testpiece is deformed into a barrel-like shape\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barreloid", "{\"term\":\"barreloid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|barrel|oid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A structure in the ventral posterior medial nucleus of the thalamus in the mouse brain, associated with a particular whisker\", \"priority\":1}]}, \"synonyms\":{}}");

	add("barrier", "{\"term\":\"barrier\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027barriere\u0027 (compare French \u0027barrière\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A structure that bars passage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An obstacle or impediment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dAmerica’s poverty line is $63 a day for a family of four. In the richer parts of the emerging world $4 a day is the poverty \u0027\u0027barrier\u0027\u0027. But poverty’s scourge is fiercest below $1.25 ([\u0026amp;hellip;]): people below that level live lives that are poor, nasty, brutish and short\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A boundary or limit\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A node (in ) said to intervene between other nodes \u0027A\u0027 and \u0027B\u0027 if it is a potential governor for \u0027B\u0027, c-commands \u0027B\u0027, and does not c-command \u0027A\", \"priority\":5}]}, \"synonyms\":{}}");

	add("barrister", "{\"term\":\"barrister\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027bar\u0027 (a collective term for lawyers or the legal profession) and the suffix \u0027-ster\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lawyer with the right to speak and argue as an advocate in higher lawcourts\", \"priority\":1}]}, \"synonyms\":{}}");

