	add("bartender", "{\"term\":\"bartender\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"1836 US, {{compound|bar|tend|-er|lang\u003den}}.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;Category:English words suffixed with -er\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who tends a bar or pub; a person preparing and serving drinks at a bar\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bartholomew", "{\"term\":\"bartholomew\", \"etymology\":{\"influencers\":[], \"languages\":[\"official aramaic (700-300 bce)\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027βαρθολομαῖος\u0027 from Official aramaic (700-300 bce) {{m|arc|בר תלמי|tr\u003dbar tolmai|gloss\u003dson of Talmai; son of Ptolemy}}, from {{m|arc|ברא|tr\u003dbra|gloss\u003dson}} and {{m|arc|תלמי|tr\u003dtolmai|gloss\u003dTalmai; Ptolemy}}. It has long been unclear whether the Apostle\u0027s father was named after the biblical Talmai, king of Geshur, or one of the Greek Ptolemies, as the two originally unrelated names were conflated in w:Judeo-Aramaic languages|Jewish Aramaic.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Apostle, identified with Nathanael\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Matthew 10: 2 - 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Now the names of the twelve apostles are these; The first, Simon, who is called Peter, and Andrew his brother; James the son of Zebedee, and John his brother; Philip, and \u0027\u0027Bartholomew\u0027\u0027; Thomas, and Matthew the publican; James the son of Alphaeus, and Lebbaeus, whose surname was Thaddaeus; Simon the Canaanite, and Judas Iscariot, who also betrayed him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"of biblical origin\", \"priority\":4}]}, \"synonyms\":{}}");

	add("bartitsu", "{\"term\":\"bartitsu\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by EW Barton-Wright in 1899, from ‘Bart(on-Wright)’ + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of martial arts based on jujitsu and also incorporating elements of boxing, savate, and stick fighting, popularized by E.W. Barton-Wright in late-Victorian London\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bartlett", "{\"term\":\"bartlett\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"From the pet form of Bartholomew\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A village in Illinoi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A city in Kansa\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A village in Nebrask\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A town in New Hampshir\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A city in Tennesse\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A city in Texas\", \"priority\":7}]}, \"synonyms\":{}}");

