	add("bartonite", "{\"term\":\"bartonite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Barton|ite|lang\u003den}}, after Paul B. Barton, Jr., sulfide petrologist with the U.S. Geological Society\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tetragonal-ditetragonal dipyramidal black brown mineral containing iron, potassium, and sulfur\", \"priority\":1}]}, \"synonyms\":{}}");

