	add("barycenter", "{\"term\":\"barycenter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bary|center|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The center of a mass; often specifically, the point at which the gravitational forces exerted by two objects are equa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the Earth–Moon \u0027\u0027barycenter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The centroid, the geometric center of a plane figure\", \"priority\":3}]}, \"synonyms\":{}}");

	add("barycentre", "{\"term\":\"barycentre\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bary|centre|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The point at the centre of a system; an average point, weighted according to mass or other attribute. The term is usually used in astronomy for the centre of mass about which a system rotates, for example, the moon and the earth rotate about a common point within the earth but not near the centre. Jupiter and the Sun rotate about a common point just outside the surface of the Sun\", \"priority\":1}]}, \"synonyms\":{}}");

